package spinyin

const PinyinFirstLetterDict = ""

var LenOf_PinyinFirstLetterDict = len(PinyinFirstLetterDict)

func SPinyin(rr []rune) string {
	bb := make([]byte, len(rr))
	for i, r := range rr {
		if r < 20 {
			bb[i] = 0
		} else if r < 127 {
			bb[i] = byte(r)
		} else if r < 19968 {
			bb[i] = 0
		} else if int(r) >= (LenOf_PinyinFirstLetterDict + 19968) {
			bb[i] = 0
		} else {
			bb[i] = PinyinFirstLetterDict[r-19968]
		}
	}
	return string(bb)
}
